package ar.edu.itba.geb.compiler.java.syntaxtree;import ar.edu.itba.geb.compiler.java.visitors.TypeVisitor;import ar.edu.itba.geb.compiler.java.visitors.Visitor;public class StringType implements Type {  private static StringType instance = new StringType();  public static StringType instance() {    return instance;  }  private StringType() { }  public void accept(Visitor v) {    v.visit(this);  }  public Type accept(TypeVisitor v) {    return v.visit(this);  }  @Override  public String toString() {    return "String";  }}